import React from 'react';

const RandomPlanet = () => {
    return (
        <nav className="random-planet">
            <h2>Planet Name</h2>

            <div className="d-flex">
                <p>Population</p>
                <p className="ml-3">123124</p>
            </div>

            <div className="d-flex">
                <p>Rotation Period</p>
                <p>43</p>
            </div>

            <div className="d-flex">
                <p>Diameter</p>
                <p>100</p>
            </div>
        </nav>
    )
};

export default RandomPlanet;
